import React from "react";
import mealsImage from "../../assets/meals.jpg";

const Header = (props) => {
  return (
    <React.Fragment>
      <header>
        <h1>Shrek's Grog</h1>
        <butto>Cart</butto>
      </header>
      <div>
        <img src={mealsImage} />
      </div>
    </React.Fragment>
  );
};

export default Header;
